var CDNColor = function() {
  // Returns a unique color for "any" i
  var currentNext = 0,
      saturation = 90,
      lightness = 50,
      p = 3, /* pointsAroundCircle */
      colors = [],
      
      calc = function(maxI) {
        // Calculate up to maxI numbers
        colors = [];
        var precision = 100000;
        var exists = {};
        var i = 0;
        var currentDenom = p;
        var currentAround = 0;
        while (i < maxI) {
          while (exists.hasOwnProperty(Math.round(precision * currentAround / currentDenom))) currentAround++;

          exists[Math.round(precision * currentAround / currentDenom)] = i;
          colors.push("hsl(" + (360 * currentAround / currentDenom) + ", " + 
                      saturation + "%, " + lightness + "%)");
          if (currentAround == currentDenom - 1) {
            currentDenom = currentDenom * 2;
            currentAround = 0;
          }
          i++;
        }
      },
      
      get = function(i) {  // i is 0-based
        if (colors.length < i + 1) { 
          calc(10 + Math.ceil(i/10) * 10);
        }
        return colors[i];
      },

      getNext = function() {
        currentNext++;
        return get(currentNext -1);
      }
  ;
  
  return {
    get:get,
    getNext:getNext
  };
}();

    this.popupDiv.style["display"] = "block";
    this.popupDiv.style["position"] = "fixed";

    this.popupDiv.style["top"] = (elRect.top + (elRect.height / 2)) + "px";
    this.popupDiv.style["left"] = (elRect.left + (elRect.width / 2)) + "px";

    this.popupDiv.appendChild(fnContent());
    
  },
  hidePopup: function() {
    if (this.popupDiv) { 
      this.popupDiv.style["display"] = "none";
    }
  },
  popup: function(el, fnContent) {
    var that = this;
    el.onmouseover = function() {
      that.showPopup(el,fnContent);
    };
    el.onmouseout = function() {
      that.hidePopup();
    };
  }
};


function CDNChart_pie() {
};
CDNHelpers.extend(CDNChart_basic, CDNChart_pie, {
  defaults : {width: 300,
              height: 200,
              unit: null,
              fnRendValue: function(v) { return v; }
             },
  getRadialPosition: function(r, angle) {
    return {
      x: this.cx + r * Math.sin(angle),
      y: this.cy - r * Math.cos(angle)
    };
  },

  draw: function() {
    var that = this;
    
    if (!this.cfg.hasOwnProperty('series')) { _e("CDNChart_pie must have series passed in the cfg"); }
    
    this.cx = this.cfg.width/2;
    this.cy = this.cfg.height/2;

    if (!this.cfg.r) this.cfg.r = Math.min(this.cfg.width, this.cfg.height)/2 - 20;

    // Add up the data values so we know how big the pie is
    var total = 0;
    var count = 0;
    for(var l in this.cfg.series.data) {
      total += this.cfg.series.data[l];
      count++;
    }
    
    // Now figure out how big each slice of pie is. Angles in radians.
    var angles = [];

    if (total == 0) {
      angles.push(1 * Math.PI*2);
    } else {
      for (var l in this.cfg.series.data) angles.push(this.cfg.series.data[l]/total * Math.PI*2);
    }
    
    // If there is only 1 slice, draw a circle
    if (angles.length == 1) {
      for (var l in this.cfg.series.data) {
        var label = l;
        var data = that.cfg.series.data[l];
      }

      that.popup(that.circle({cx:that.cx, cy:that.cy, r:that.cfg.r,
                              fill:that.getColor(0, that.cfg.series),
                              "stroke-dasharray":that.getDash(0, that.cfg.series),
                              stroke:"white",
                              'stroke-width':"1"}),
                 function() {
                   var d = document.createElement('DIV');
                   d.appendChild(document.createTextNode(label));
                   d.appendChild(document.createElement('BR'));
                   d.appendChild(document.createTextNode(that.cfg.fnRendValue(data)));
                   return d;
                   });
    }
    
    // Loop through each slice of pie.
    var startAngle = 0;
    var i = 0;
    for (var l in this.cfg.series.data) {
      var scope = function () {
        var label = l;
        var data = that.cfg.series.data[l];
        
        var endAngle = startAngle + angles[i];
        var labelAngle = (startAngle + endAngle) / 2;

        var startPos = that.getRadialPosition(that.cfg.r, startAngle);
        var endPos = that.getRadialPosition(that.cfg.r, endAngle);
        var big = 0;
        if (endAngle - startAngle > Math.PI) big = 1;

        if (startPos.x && endPos.x) {
          if (data === total) {
            that.popup(that.circle({cx:that.cx, cy:that.cy, r:that.cfg.r,
                                  fill:that.getColor(i, that.cfg.series),
                                  "stroke-dasharray":that.getDash(i, that.cfg.series),
                                  stroke:"white",
                                  'stroke-width':"1"}),
                       function() {
                         var d = document.createElement('DIV');
                         d.appendChild(document.createTextNode(label));
                         d.appendChild(document.createElement('BR'));
                         d.appendChild(document.createTextNode(that.cfg.fnRendValue(data)));
                         return d;
                     });
          } else {
            that.popup(that.path({d:("M " + that.cx + "," + that.cy + 
                                     " L " + startPos.x + "," + startPos.y +
                                     " A " + that.cfg.r + "," + that.cfg.r + 
                                     " 0 " + big + " 1 " + 
                                     endPos.x + "," + endPos.y +   
                                     " Z"),
                                  fill:that.getColor(i, that.cfg.series),
                                  "stroke-dasharray":that.getDash(i, that.cfg.series),
                                  stroke:"white",
                                  'stroke-width':"1"}),
                       function() {
                         var d = document.createElement('DIV');
                         d.appendChild(document.createTextNode(label));
                         d.appendChild(document.createElement('BR'));
                         d.appendChild(document.createTextNode(that.cfg.fnRendValue(data)));
                         return d;
                     });
          }
        } else {
          _e('Could not draw pie slice with r:' + that.cfg.r + ' startAngle:' + startAngle + ' endAngle:' + endAngle);
        }
        
        // Add labels
        var labelStart = that.getRadialPosition(that.cfg.r + 3, labelAngle);
        var labelEnd = that.getRadialPosition(that.cfg.r + 8, labelAngle);
        if (labelStart.x && labelEnd.x) {
          that.path({d:("M " + labelStart.x + "," + labelStart.y +
                        " L " + labelEnd.x + "," + labelEnd.y),
                     stroke:"#999",
                     "stroke-width":"1"});
        } else {
            _e('Could not draw label with r:' + that.cfg.r + ' labelAngle:' + labelAngle);
        }

        var labelPos = that.getRadialPosition(that.cfg.r + 10, labelAngle);
        var rightNotLeft = labelAngle < Math.PI;
        var topNotBottom = labelAngle < Math.PI/2 || labelAngle > Math.PI * 3 / 2;
        that.text({x:labelPos.x,
                   y:labelPos.y,
                   "class":'pie-slice-label',
                   "text-anchor":(rightNotLeft
                                  ? "start" // right half
                                  : "end"   // left half
                                 ),
                   dy:(topNotBottom
                       ? 0 // top half
                       : 6 // bottom half
                      )})
          .appendChild(document.createTextNode((rightNotLeft ? that.cfg.fnRendValue(that.cfg.series.data[l]) + ' ' : '')
                                               + label
                                               + (rightNotLeft ? '' : ' ' + that.cfg.fnRendValue(data))));
        // The next wedge begins where this one ends
        startAngle = endAngle;
      }();
      i++;
    }
    
    // Add a center circle with data
    this.circle({cx:this.cx, cy:this.cy, r:45, fill:"white"});
  

    this.text({x:this.cx,
               y:this.cy,
               dy:-15,
               "class":'pie-label',
               "text-anchor":"middle"})
      .appendChild(document.createTextNode(this.cfg.series.hasOwnProperty('name')
                                           ? this.cfg.series.name
                                           : "TOTAL"));
    
    this.text({x:this.cx,
               y:this.cy,
               dy:7,
               "class":'pie-total',
               "text-anchor":"middle"})
      .appendChild(document.createTextNode(this.cfg.fnRendValue(this.cfg.series.hasOwnProperty('total') ? this.cfg.series.total : total)));

    if (this.cfg.unit) {
      this.text({x:this.cx,
                 y:this.cy,
                 dy:24,
                 "class":'pie-units',
                 "text-anchor":"middle"})
        .appendChild(document.createTextNode(this.cfg.unit));
    }
  }
});


/* A line chart is a number of series with values where each value is given
 by a label.
 Note - we will use an xy chart for series with two values
 */
function CDNChart_line() {
};
CDNHelpers.extend(CDNChart_basic, CDNChart_line, {
  defaults : {width: 1000,
              height: 250,
              legendWidth: 200,
              legendOffset: 10,
              legendLineStroke: 1,
              unit: null,
              yAxisName: null,
              xAxisName: null,
              yAxisLabelMinSeparation: 30,
              yAxisMin: null,
              yAxisMax: null,
              yAxisRenderer: null,
              xAxisLabels: null,
              xAxisLines: true,
              yAxisGutter: 50, // distance from left edge to Y axis
              xAxisGutter: 30, // distance from bottom edge to X axis
              xAxisLabelLineGutter: 10, // extra distance for each line in the x axis label names
              firstLabelGutter: 30, // distance from the y axis to the first point
              topGutter: 10,
              roundYTo: [],
              fnRendValue: function(v) {
                return v;
              }
             },

  min: +Infinity,
  max: -Infinity,
  labels: [],

  getRealHeight: function() {
    /* Return the height of the chart area, not including the gutters*/
    return (this.cfg.height - this.cfg.topGutter - this.cfg.xAxisGutter - this.cfg.xAxisLabelLineGutterVal);
  },

  getHeightRatio: function() {
    /* Return the ratio between Y values and picels. */
    return (this.max - this.min)/this.getRealHeight();
  },

  getY: function(y) { /* Can return null */
    var x = 0;
    if (this.min < this.max) {
      // This is the normal case
      x = (y - this.min) / (this.max - this.min);
    } else if (this.min == this.max) {
      // There is only a single value - put this value in the middle of the graph
      x = 0.5;
    }
    return Math.round(this.cfg.topGutter + ((1 - x) * this.getRealHeight()));
    // TODO: convert 
  },

  calculateRanges: function() {
    /* Work out the labels and the min/max values */
    this.min = +Infinity;
    this.max = -Infinity;
    this.labels = [];
    
    var labelSeq = new CDNHelpers.SequenceCombiner();
    for (var i=0; i<this.cfg.arSeries.length; i++) {
      var seq = [];
      for (var l in this.cfg.arSeries[i].data) {
        seq.push(l);
        var v = this.cfg.arSeries[i].data[l];
        this.min = Math.min(this.min, v.graph);
        this.max = Math.max(this.max, v.graph);
      }
      labelSeq.mergeWith(seq);
    }
    this.labels = labelSeq.sequence;
    labelSeq = undefined;

    // Override any of the min/max/labels if they are set in the config
    if (this.cfg.yAxisMin !== null) this.min = this.cfg.yAxisMin;
    if (this.cfg.yAxisMax !== null) this.min = this.cfg.yAxisMax;
    if (this.cfg.xAxisLabels !== null) this.labels = this.cfg.xAxisLabels;

    // Increase the x axis gutter for any \n's in the xaxis lables
    var xLabelLines = 0;
    for (var i=0; i<this.labels.length; i++) {
      xLabelLines = Math.max(xLabelLines, this.transXLabel(this.labels[i]).split(/\n/).length);
    }
    this.cfg.xAxisLabelLineGutterVal = xLabelLines * this.cfg.xAxisLabelLineGutter;
  },

  transXLabel: function(dataLabel) {
    if (this.cfg.hasOwnProperty('transXLabel')
        && this.cfg.transXLabel.hasOwnProperty(dataLabel))
      return this.cfg.transXLabel[dataLabel];
    else
      return dataLabel;
  },

  calculateYLabels: function() {
    this.YLabels = {};

    this.YLabels[this.min] = this.min;
    this.YLabels[this.max] = this.max;

    // Add other interesting points
    var minsep = Math.max(0, this.cfg.yAxisLabelMinSeparation * this.getHeightRatio());
    // Standard multiples are [2, 2.5, 2]
    var stdMul = function(roundYTo) {
      return function() {
        var r = roundYToCopy.pop();
        if (r) {
          return r;
        } else {
          count = (count+1) % 3;
          return count? 2 : 2.5;
        }
      };
    }(this.cfg.roundYTo);

    
    for (var s = 1; s > minsep/100; s /= 10) {};
    var roundYToCopy = this.cfg.roundYTo.slice();
    var count = 1;
    while (s < minsep) {
      var m = roundYToCopy.pop();
      if (!m) {
        count = (count+1) % 3;
        m = count? 2 : 2.5;
      }
      s *= m;
    }

    if (s == 0) { return; }
    
    var start = this.min + s, end = this.max-(s/2);
    
    for (var i = start; i <= end; i += s) {
      var ii = Math.round(i/s) * s;
      this.YLabels[ii] = ii;
    }
  },

  calculateLabelX: function() {
    
    this.labelX = {};

    var xFirst = this.cfg.yAxisGutter + this.cfg.firstLabelGutter;
    var xLast = this.cfg.width - this.cfg.legendWidth;
    
    
    switch (this.labels.length) {
    case 0: return;
    case 1:
      this.labelX[this.labels[0]] = (xFirst + xLast) / 2;
      break;
    default: 
      var xSeparation = (xLast - xFirst) / (this.labels.length - 1);
      for (var i=0; i<this.labels.length; i++) {
        this.labelX[this.labels[i]] = Math.round(xFirst + i * xSeparation);
      }
    }
  },

  drawXAxis: function() {
    for (var label in this.labelX) {
      if (this.cfg.xAxisLines) {
        // draw a feint line vertically across the whole chart
        this.path({d:("M " + this.labelX[label] + "," + this.cfg.topGutter
                      + " L " + this.labelX[label] + "," + (this.cfg.height - this.cfg.xAxisGutter - this.cfg.xAxisLabelLineGutterVal)),
                   stroke:'#CCC',
                   "stroke-width":1});
      }
      
      // draw a text label at the bottom
      var xLines = this.transXLabel(label).split(/\n/);
      for (var i=0; i<xLines.length; i++) {
        this.text({x: this.labelX[label],
                   y: (this.cfg.height - this.cfg.xAxisGutter - this.cfg.xAxisLabelLineGutterVal + (i * this.cfg.xAxisLabelLineGutter) + 4),
                   "class": "pie-slice-label",
                   "text-anchor": "end",
                   dy: "0.5em",
                   transform:"rotate(330 " + this.labelX[label] + "," + (this.cfg.height - this.cfg.xAxisGutter - this.cfg.xAxisLabelLineGutterVal + (i * this.cfg.xAxisLabelLineGutter) + 2) + ")"
                  })
          .appendChild(document.createTextNode(xLines[i]));
      }
    }
  },

  drawYAxis: function() {
    // draw a feint line vertically across the whole chart
    this.path({d:("M " + this.cfg.yAxisGutter + "," + this.cfg.topGutter
                  + " L " + this.cfg.yAxisGutter + "," + (this.cfg.height - this.cfg.xAxisGutter - this.cfg.xAxisLabelLineGutterVal)),
               stroke:'#000',
               "stroke-width":1});
      
    // Draw each of the ylabels
    for (var label in this.YLabels) {
      var y = this.getY(this.YLabels[label]);
      // Add a mark
      this.path({d:("M " + (this.cfg.yAxisGutter - 3) + "," + y
                    + " L " + (this.cfg.yAxisGutter + 1) + "," + y),
                 stroke:'#000',
                 "stroke-width":1});
      
      // add the text
      this.text({x: this.cfg.yAxisGutter - 5,
                 y: y,
                 "class": "pie-slice-label",
                 "text-anchor": "end",
                 dy: "0.5em"
                })
      .appendChild(document.createTextNode(this.cfg.fnRendValue(label)));
    }

    // draw the axisname
    if (this.cfg.yAxisName) {
      this.text({x: this.cfg.yAxisGutter +2,
                 y: this.cfg.topGutter,
                 "class": "pie-slice-label",
                 "text-anchor": "end",
                 dy: "1em",
                 transform:"rotate(270 " + (this.cfg.yAxisGutter + 2) + "," + this.cfg.topGutter + ")"
                })
      .appendChild(document.createTextNode(this.cfg.yAxisName));
    }
  },

  drawAllSeries: function() {
    var that = this;
    
    for (var i=0; i<this.cfg.arSeries.length; i++) {
      var lastPoint = null;
      var color = this.getColor(i, this.cfg.arSeries[i]);
      var dash = this.getDash(i, this.cfg.arSeries[i]);
          
      
      for (var label in this.cfg.arSeries[i].data) {
        var val = this.cfg.arSeries[i].data[label];
        if (val === null) continue;

        var point = {x: that.labelX[label],
                     y: that.getY(val.graph)};
        
        var scope = function() {
          var thisName = that.cfg.arSeries[i].hasOwnProperty('name') ? that.cfg.arSeries[i].name : null;
          var thisLabel = label;
          var thisVal = val;
          
          var thisPoint = point;
          
          // Draw a marker
          that.popup(that.circle({cx:thisPoint.x, cy:thisPoint.y, r:3, fill:color}),
                     function() {
                       var d = document.createElement('DIV');
                       if (thisName !== null) {
                         d.appendChild(document.createTextNode(thisName));
                         d.appendChild(document.createElement('BR'));
                       }
                       d.appendChild(document.createTextNode(thisLabel));
                       d.appendChild(document.createElement('BR'));
                       d.appendChild(document.createTextNode(that.cfg.fnRendValue(thisVal.original)));
                       return d;
                     }
                    );
          
        }();
        
        // Draw a line since the last point
        if (lastPoint) {
          this.path({
            d:("M " + lastPoint.x + "," + lastPoint.y
               + " L " + point.x + "," + point.y),
            stroke:color,
            "stroke-dasharray":dash,
            "stroke-width":2});
        }

        lastPoint = point;
      }
    }
  },

  drawLegend: function() {
    var legendLineWidth = 30;
    var currentY = 50;
    var x = this.cfg.width - this.cfg.legendWidth + this.cfg.legendOffset;
    
    var bFound = false;
    
    for (var c in this.cfg.colorName) {
      bFound = true;
      
      this.path({d:("M " + x + "," + currentY +
                    " L " + (x + legendLineWidth) + "," + currentY),
                 stroke: c,
                 "stroke-width":this.cfg.legendLineStroke});

      this.text({x: x + legendLineWidth + 3,
                 y: currentY,
                 dy: "0.3em",
                 "class":'pie-slice-label',
                 "text-anchor": "start"
                 })
      .appendChild(document.createTextNode(this.cfg.colorName[c]));
      currentY += 10;
    }

    if (bFound) currentY += 20;
    
    for (var d in this.cfg.dashName) {
      bFound = true;
      
      this.path({d:("M " + x + "," + currentY +
                    " L " + (x + legendLineWidth) + "," + currentY),
                 stroke: "black",
                 "stroke-dasharray": d,
                 "stroke-width":"1"});
      
      this.text({x: x + legendLineWidth + 3,
                 y: currentY,
                 dy: "0.3em",
                 "class":'pie-slice-label',
                 "text-anchor": "start"
                 })
      .appendChild(document.createTextNode(this.cfg.dashName[d]));
      
      currentY += 10;
    }

  },

  convertSimpleDataToPoint: function() {
    for (var i=0; i<this.cfg.arSeries.length; i++) {
      for (var k in this.cfg.arSeries[i].data) {
        var v = this.cfg.arSeries[i].data[k];
        this.cfg.arSeries[i].data[k] = {original:v, graph:v};
      }
    }
  },

  fiddleData: function() {
    return;
  },
  
  draw: function() {

    if (!this.cfg.hasOwnProperty('arSeries')) { _e("CDNChart_line must have arSeries passed in the cfg"); }
    if (!this.cfg.arSeries.length) { _e("CDNChart_line must be passed with at least one arSeries in the cfg"); return; }

    this.convertSimpleDataToPoint();
    
    this.fiddleData();
    
    this.calculateRanges();

    this.calculateYLabels();

    this.calculateLabelX();

    this.drawXAxis();

    this.drawYAxis();
    
    this.drawAllSeries();

    this.drawLegend();
  }
});


function CDNChart_column() {
};
CDNHelpers.extend(CDNChart_line, CDNChart_column, {
  fiddleData: function(cfg) {
    // Assume all column charts are stacked, hence we need to add up the 
    // different series totals
    for (var k in this.cfg.arSeries[0].data) {
      var total = 0;
      for (var i=0; i<this.cfg.arSeries.length; i++) {
        total = this.cfg.arSeries[i].data[k].original + total;
        this.cfg.arSeries[i].data[k].graph = total;
      }
    }
  },

  drawAllSeries: function() {
    var that = this;
    
    for (var i=0; i<this.cfg.arSeries.length; i++) {
      var color = this.getColor(i, this.cfg.arSeries[i]);
      
      for (var label in this.cfg.arSeries[i].data) {
        var val = this.cfg.arSeries[i].data[label];
        if (val === null) continue;

        // The point is the top left corner of the column
        var point = {x: that.labelX[label],
                     y: that.getY(val.graph)};
        
        var scope = function() {
          var thisName = that.cfg.arSeries[i].hasOwnProperty('name') ? that.cfg.arSeries[i].name : null;
          var thisLabel = that.transXLabel(label);
          var thisVal = val;
          
          var thisPoint = point;
          
          // Draw a rect
          var height = that.getY(thisVal.graph - thisVal.original) - thisPoint.y;
          var width = 20;
          
          that.popup(that.rect({x:thisPoint.x - (width/2),
                                y:thisPoint.y,
                                height: height,
                                width: width,
                                fill:color}),
                     function() {
                       var d = document.createElement('DIV');
                       if (thisName !== null) {
                         d.appendChild(document.createTextNode(thisName));
                         d.appendChild(document.createElement('BR'));
                       }
                       d.appendChild(document.createTextNode(thisLabel));
                       d.appendChild(document.createElement('BR'));
                       d.appendChild(document.createTextNode(that.cfg.fnRendValue(thisVal.original)));
                       return d;
                     }
                    );
          
          // draw text in the middle if it is big enough
          if (height > 10) {
            that.text({x:thisPoint.x,
                       y:thisPoint.y + (height/2),
                       "class":'pie-slice-label',
                       "text-anchor":"middle",
                       dy:6
                      })
              .appendChild(document.createTextNode(thisVal.original));
          }
        }();
      }
    }    
  }
});

    // reliably query the month using UTC methods without DST issues.

    this._calendarDate.setHours(12, 0, 0, 0);

  DatePicker.prototype.show = function() {

      if (! isNaN(compareSize)) {

          element: element,
          diffPerc: diffPerc

      } else {
        comparisons.push({
          element: element,
          diffPerc: 0,
          notNumber: true

      }

    for (i = 0; i < comparisons.length; i++) {
      diffPerc = comparisons[i].diffPerc;
      element = comparisons[i].element;

      if (diffPerc === 0 || biggestDiffPerc === 0) {
        element.style.backgroundColor = '';

        // Bigger - red
        diffMulti = diffPerc / biggestDiffPerc;
        r = Math.round(255 - ((255 - 223) * diffMulti));
        g = Math.round(255 - ((255 - 53) * diffMulti));
        b = g;

      } else {

        r = Math.round(255 - ((255 - 40) * diffMulti));
        g = Math.round(255 - ((255 - 197) * diffMulti));
        b = Math.round(255 - ((255 - 26) * diffMulti));

      }
    }

      CDNHelpers.removeChildren(this.gradientHighest);
      CDNHelpers.removeChildren(this.gradientLowest);
    } else {
      this.gradientHighest.textContent = '+' + biggestDiffPerc.toFixed(1) + '%';
      this.gradientLowest.textContent = '-' + biggestDiffPerc.toFixed(1) + '%';
    }
  };


  window.CDNTreemap = CDNTreemap;

      var i;

      for (i = 0; i < snapshots.length; i++) {
        snapshots[i].path = snapshots[i].path.split('/').slice(1).join('/');
        stripSnapshotLevel(snapshots[i].snapshots);

    }

    function mangleSnapshot(snapshot) {
      var metrics;
      if (snapshot.metrics instanceof Array) {
        metrics = {};
        snapshot.metrics.map(function(metric) {
          metrics[metric.name] = metric;

        snapshot.metrics = metrics;
      }

      if (snapshot.snapshots) {
        snapshot.snapshots.map(mangleSnapshot);
      } else {
        snapshot.snapshots = [];
      }
      snapshot.run_id = '' + i;
    }

    for (i = 0; i < window.runs.length; i++) {
      run = window.runs[i];

      // Run/Testsuite looks like a snapshot
      run.path = '';
      run.run_id = '' + i;
      run.name = run.run_id;

      if (hideSingleTopLevel && run.snapshots.length === 1 && run.snapshots[0].snapshots && run.snapshots[0].snapshots.length > 0) {
        // Single top-level snapshot, cut it out of the hierarchy (assume it is
        // a single top-level flow snapshot e.g. block)
        run.metrics = run.snapshots[0].metrics;
        run.snapshots = run.snapshots[0].snapshots;
        stripSnapshotLevel(run.snapshots);

      run.snapshots.map(mangleSnapshot);

      if (run.metrics instanceof Array) {

    defaults = {};

    newHash = {};

    neededUpdate = false;
    for (key in defaults) {
      if (hashed[key] === undefined) {
        newHash[key] = defaults[key];
        neededUpdate = true;
      } else {
        newHash[key] = hashed[key];
      }
    }

    if (cdnPage.getMode() === cdnPage.MODE_SUM) {
      if (hashed.run instanceof Array) {
        hashedRuns = hashed.run;
      } else if (hashed.run !== undefined) {
        hashedRuns = [hashed.run];
      } else {
        hashedRuns = [];
      }
      runs = this.fetcher.getRunIds();
      if (! CDNHelpers.shallowEqual(hashedRuns, runs)) {
        newHash.run = runs;
        neededUpdate = true;
      }
      if (hashed.testsuite) {
        newHash.testsuite = null;
        neededUpdate = true;
      }
      if (hashed.history) {
        newHash.history = null;
        neededUpdate = true;
      }

      cdnPage.updateHash(newHash);
    }

  };

  CDNDataManager.prototype.hashchange = function(hashed, preventUpdate) {
    var updated, comparisonPath, comparisonDesign, historyDates, comparisonRuns, comparisonTestsuites, updatedMethod;

    // Use local cached copies of the variables so we can not apply them if we
    // going to get another hashchange event due to a partialHash
    comparisonPath = this.comparisonPath;
    comparisonDesign = this.comparisonDesign;
    comparisonRuns = this.comparisonRuns;
    historyDates = this.historyDates;
    comparisonTestsuites = this.comparisonTestsuites;

    if (this.applyHashDefaults(hashed)) {
      // If defaults were applied, the hash was updated (which will call this
      // function again so return immediately)
      return;
    }

    comparisonPath = hashed.path || '';

    comparisonDesign = hashed.run_header;
    historyDates = hashed.history_span;

    if (hashed.run instanceof Array) {
      comparisonRuns = hashed.run;
    } else if (hashed.run !== undefined) {
      comparisonRuns = [hashed.run];
    } else {
      comparisonRuns = [];
    }

    if (hashed.testsuite instanceof Array) {
      comparisonTestsuites = hashed.testsuite;
    } else if (hashed.testsuite !== undefined) {
      comparisonTestsuites = [hashed.testsuite];
    } else {
      comparisonTestsuites = [];
    }

    updated = false;
    if (this.comparisonPath !== comparisonPath) {
      updated = true;
      this.comparisonPath = comparisonPath;
    }
    if (this.comparisonDesign !== comparisonDesign) {
      updated = true;
      this.comparisonDesign = comparisonDesign;
    }
    if (this.historyDates !== historyDates) {
      updated = true;
      this.historyDates = historyDates;
    }
    if (! CDNHelpers.shallowEqual(this.comparisonRuns, comparisonRuns)) {
      updated = true;
      this.comparisonRuns = comparisonRuns;
    }
    if (! CDNHelpers.shallowEqual(this.comparisonTestsuites, comparisonTestsuites)) {
      updated = true;
      this.comparisonTestsuites = comparisonTestsuites;
    }

    updatedMethod = false;
    if (this.comparisonRuns.length > 0 &&
        this.comparisonMethod !== CDNDataManager.COMPARE_RUNS) {
      updated = true;
      updatedMethod = true;
      this.comparisonMethod = CDNDataManager.COMPARE_RUNS;
    } else if (this.comparisonRuns.length === 0 && hashed.history &&
        this.comparisonMethod !== CDNDataManager.COMPARE_HISTORY) {
      updated = true;
      updatedMethod = true;
      this.comparisonMethod = CDNDataManager.COMPARE_HISTORY;
    } else if (this.comparisonRuns.length === 0 && !hashed.history &&
        this.comparisonMethod !== CDNDataManager.COMPARE_TESTSUITES) {
      updated = true;
      updatedMethod = true;
      this.comparisonMethod = CDNDataManager.COMPARE_TESTSUITES;
    }

    if (updated && !preventUpdate) {
      console.log('hashChange - CDNDataManager notify event');
      this._notifyNewData();
    }
    if (updatedMethod) {
      this._notifyNewDefaultConfig();
    }
  };

    if (! subPath) {
      return undefined;
    }

    switch (this.comparisonMethod) {
    case CDNDataManager.COMPARE_RUNS:
      exists = false;
      // Filter out empty path components to remove duplicated, leading and
      // trailing slashes
      components = this.comparisonPath.split('/').filter(function(path) {return !! path});
      components.push(subPath);
      path = components.join('/');

        // fetch from cache only so we don't initiate any requests and we can do
        // this synchronously. This requires the caller to be careful
        this.fetcher.getSnapshotByPath(this.comparisonRuns[i], path, existCheck, true);
        if (exists) {
          break;
        }
      }

      if (exists) {
        return cdnPage.getUrlForNewHash(CDNHelpers.assignObj({}, extraHash, {path: path}));
      }
      break;
    case CDNDataManager.COMPARE_TESTSUITES:

        // this synchronously. This requires the caller to be careful

                runs.push(testsuite.snapshots[i].id);
                break;
              }
            }
          }
        }, true);
      }

      if (runs.length) {
        hash = CDNHelpers.assignObj({}, extraHash, {run: runs, path: cdnDataManager.getComparisonPath()});
        if (forcedSubPath) {
          hash.path = forcedSubPath;
        }
        return cdnPage.getUrlForNewHash(hash);
      }
      break;
    case CDNDataManager.COMPARE_HISTORY:
      hash = CDNHelpers.assignObj({}, extraHash, {run: [subPath], path: null, history: false});
      return cdnPage.getUrlForNewHash(hash);

      console.warn('Request for subpath url with unknown comparison method: '+this.comparisonMethod);
      return undefined;
    }

  // Last added testsuite is gold
  CDNDataManager.prototype.addTestsuite = function(id, prepareHashOnly, clearRuns, makeGold, keepTab) {
    var index, hash;

    hash = {};
    if (clearRuns) {
      hash.run = null;
    }

    if (keepTab) {
      hash.tab = cdnPage.activeTab;
    }

    hash.testsuite = this.comparisonTestsuites.slice();
    index = hash.testsuite.indexOf(id);
    if (index < 0) {
      if (makeGold) {
        hash.testsuite.push(id);
      } else {
        hash.testsuite.unshift(id);
      }
      cdnPage.updateHash(hash);
    } else if (makeGold && index === hash.testsuite.length - 1) {
      // Already gold, nothing to do
    } else if (makeGold) {
      // Make the "added" testsuite the gold testsuite
      hash.testsuite.splice(index, 1);
      hash.testsuite.push(id);
      cdnPage.updateHash(hash);
    } else if (index > 0) {
      // Make the "added" testsuite the left-most testsuite (gold is right-most)
      hash.testsuite.splice(index, 1);
      hash.testsuite.unshift(id);

  CDNMetricComparison.prototype._compare = function(description, goldDescription, targetValue, warningValue, threshold, comparison) {

    value = description.rawValueLimited;
    goldValue = goldDescription && goldDescription.rawValueLimited;

    case CDNMetricComparison.CMP_SMALLER:

        compare = CDNMetricComparison.BAD;

          ignoreCompare = false;
        }

            ignoreCompare = false;
          } else {
            target = CDNMetricComparison.GOOD;

          target = CDNMetricComparison.BAD;
          ignoreCompare = false;
        }
      }
      break;
    case CDNMetricComparison.CMP_LARGER_LIMITED:
      ignoreCompare = true;
      /* fallthrough */
    case CDNMetricComparison.CMP_LARGER:
      if (value > goldValue) {
        compare = CDNMetricComparison.GOOD;
      } else if (value < goldValue) {
        compare = CDNMetricComparison.BAD;
      }
      if (targetValue === undefined) {
        if (warningValue === undefined) {
          ignoreCompare = false;
        } else if (value < warningValue) {
          target = CDNMetricComparison.WARNING;
          ignoreCompare = false;
        }
      } else {
        if (value >= targetValue) {
          if (warningValue !== undefined && value < warningValue) {
            target = CDNMetricComparison.WARNING;
            ignoreCompare = false;
          } else {
            target = CDNMetricComparison.GOOD;
          }
        } else if (value < targetValue) {
          target = CDNMetricComparison.BAD;
          ignoreCompare = false;
        }
      }

      if (value >= 0 || goldValue >= 0) {
        compare = CDNMetricComparison.NEUTRAL;
      } else if (value > goldValue) {
        compare = CDNMetricComparison.GOOD;
      } else if (value < goldValue) {
        compare = CDNMetricComparison.BAD;
      }
      if (targetValue !== undefined) {
        if (value >= targetValue) {
          target = CDNMetricComparison.GOOD;
        } else if (value < targetValue) {
          target = CDNMetricComparison.BAD;
        }
      }
      break;

      comparison = CDNMetricComparison.CMP_DIFF;
      /* fallthrough */
    case CDNMetricComparison.CMP_DIFF:
      if (value !== goldValue) {
        compare = CDNMetricComparison.BAD;
      }

      if (inThreshold) {

          compare = CDNMetricComparison.GOOD_BELOW_THRESHOLD;
        } else if (compare === CDNMetricComparison.BAD) {
          compare = CDNMetricComparison.BAD_BELOW_THRESHOLD;
        } else {

        }
      } else {

      }

      compare = CDNMetricComparison.NEUTRAL;
    }

        break;
      case CDNMetricSummaryComparison.MAXIMUM:
        for (i = 0; i < descriptions.length; i++) {
          if (descriptionsByMetricComparison[i].some(function(desc) {return ! desc || ! desc.defined;})) {

          }
          description = descriptions[i];
          if (description) {
            if (description.number) {

  CDNPage.prototype.updateViewSelection = function() {

  CDNPage.prototype.render = function() {

    // Remove old components
    for (i = 0; i < this.components.length; i++) {
      this.components[i].finalize();
    }
    this.components = [];
    this.configEditors = [];

    tabConfig = this.getTabConfig(this.activeTab);

    CDNHelpers.removeChildren(this.content);
    if (! tabConfig) {
      return;
    }

    containers = [];

    oldConfig = false;
    // Create the new components
    for (i = 0; i < tabConfig.length; i++) {
      componentConfig = tabConfig[i];
      if (componentConfig.view && !componentConfig.component) {
        oldConfig = true;
        console.error('OLD page config format detected - skipping old view "'+componentConfig.view+'"');
        continue;
      }
      componentContainer = document.createElement('div');
      componentContainer.setAttribute('data-component', componentConfig.component);
      if (componentConfig.id) componentContainer.setAttribute('data-id', componentConfig.id);
      configEditor = new CDNConfigEditor(componentConfig);
      componentElement = document.createElement('div');
      componentContainer.appendChild(componentElement);
      componentConstructor = window[componentConfig.component];
      if (componentConstructor) {
        component = new componentConstructor(componentElement, componentConfig);
        configEditor.setComponent(component);
        this.components.push(component);
      } else {
        p = document.createElement('p');
        p.className = 'cdn-page-component-missing';
        p.textContent = 'ERROR: Could not find the "' + componentConfig.component + '" page component';
        componentElement.appendChild(p);
        console.error('Could not find the "' + componentConfig.component + '" page component');
      }
      componentDescription = this.describeComponent(componentConfig, configEditor, component);
      if (componentDescription) {
        componentContainer.insertBefore(componentDescription, componentElement);
        componentContainer.className = 'cdn-page-component-editable';

      this.configEditors.push(configEditor);
      containers.push(componentContainer);
    }

    if (oldConfig) {
      p = document.createElement('p');
      p.className = 'cdn-page-component-missing';
      p.textContent = 'ERROR: deprecated page configuration format detected, you must migrate your metric_page_cfg';
      this.content.appendChild(p);
    }

    // reduce redraws of the page
    for (i = 0; i < containers.length; i++) {
      this.content.appendChild(containers[i]);
    }
    this.content.className = '';

    if (this.pendingHashed.table) {
      // Scroll to the table
      setTimeout(function(id) {
        var table, offset, content;
        table = document.querySelector('[data-id="'+id+'"]');
        if (table) {
          offset = table.offsetTop - this.content.offsetTop;
          if (document.scrollingElement) {
            document.scrollingElement.scrollTop = offset;
          } else {
            document.body.scrollTop = offset;
          }
        } else {
          console.log('Didn\'t find table with ID '+id);
        }
      }.bind(this, this.pendingHashed.table), 0);
    }
  };

  CDNPage.prototype.renderDeltaButton = function() {

      {delta: 'none', attr: 'no-delta', title: 'Hide comparison differences'},
      {delta: 'raw', attr: 'raw-delta', title: 'Show raw value comparison differences'},
      {delta: false, attr: 'perc-delta', title: 'Show percentage comparison differences'}
    ];

    CDNHelpers.removeChildren(this.deltaContainer);

    if (cdnDataManager.getComparisonCount() > 1) {
      for (i = 0; i < options.length; i++) {

      // Add the colorblind changer button - this only affects comparisons so

      button = document.createElement('a');
      button.className = 'colorblind-button';
      button.title = 'Toggle colour blind mode';
      button.addEventListener('click', function(event) {
        event.preventDefault();
        if (document.body.hasAttribute('data-colorblind')) {

  CDNPage.prototype.getUrlForNewHash = function(newHash) {
    var modifiedHash, key, value, found, i, tabName;

    modifiedHash = CDNHelpers.shallowClone(this.pendingHashed);
    delete modifiedHash.table;

    CDNHelpers.assignObj(modifiedHash, newHash);
    for (key in modifiedHash) {
      value = modifiedHash[key];
      if (value === undefined || value === null) {
        delete modifiedHash[key];
      }
    }
    if (modifiedHash.table && modifiedHash.view === this.pendingHashed.view) {
      // Pre-populate the tab field to remove a redirect if we can
      found = false;
      for (tabName in this.activeConfig) {
        if (this.activeConfig[tabName]) {
          for (i = 0; i < this.activeConfig[tabName].length; i++) {
            if (this.activeConfig[tabName][i] && this.activeConfig[tabName][i].id === modifiedHash.table) {
              found = true;
              modifiedHash.tab = tabName;
              break;
            }
          }
        }
        if (found) {
          break;
        }
      }
    }

    return this.hashStrFromObj(modifiedHash);
  };

  CDNPage.prototype.renderTabs = function(tabNames) {
    var i, container, link, modifiedHash, editButton;

    if (tabNames) {
      this._cachedTabNames = tabNames;
    } else {
      tabNames = this._cachedTabNames;
    }

    CDNHelpers.removeChildren(this.tabContainer);

    modifiedHash = CDNHelpers.shallowClone(this.pendingHashed);
    delete modifiedHash.table;

    for (i = 0; i < tabNames.length; i++) {
      container = document.createElement('div');
      container.className = 'tab';
      if (tabNames[i] === this.activeTab) {
        container.setAttribute('data-selected', 'yes');
        container.textContent = tabNames[i];
      } else {
        link = document.createElement('a');
        modifiedHash.tab = tabNames[i];
        link.href = this.hashStrFromObj(modifiedHash);
        link.textContent = tabNames[i];
        container.appendChild(link);
      }
      this.tabContainer.appendChild(container);
    }

    /*
    editButton = document.createElement('button');
    editButton.id = 'tab-edit-button';
    editButton.textContent = 'Edit';
    editButton.title = 'Change tabs';
    editButton.disabled = true;
    this.tabContainer.appendChild(editButton);
    */
  };

  CDNPage.prototype.getDeltaPresentationMode = function() {
    return this.showingPercent ? 'percentDiff' : 'rawDiff';
  };

  CDNPage.prototype.newConfig = function(config) {
    var tabName, tabNames, modifiedHash, i, found;

    tabNames = [];
    for (tabName in config) {
      tabNames.push(tabName);
    }

    if (this.pendingHashed.table) {
      found = false;
      for (tabName in config) {
        if (config[tabName]) {
          for (i = 0; i < config[tabName].length; i++) {
            if (config[tabName][i] && config[tabName][i].id === this.pendingHashed.table) {
              found = true;
              this.activeTab = tabName;
              modifiedHash = CDNHelpers.shallowClone(this.pendingHashed);
              modifiedHash.tab = this.activeTab;
              this.updateHash(modifiedHash);
              break;
            }
          }
        }
        if (found) {
          break;
        }
      }
    }
    if (config[this.activeTab] === undefined) {
      if (this.updateHash({tab: null})) {
        return;
      }
      this.activeTab = tabNames[0];
    }

    this.render();
    this.renderTabs(tabNames);
  };

  CDNPage.prototype.getTabConfig = function(title) {

  };

  CDNPage.prototype.fetchActiveConfig = function() {

      console.log('CDNPage - Not fetching config as activeConfigName is unset');
      return;
    }

    this.content.setAttribute('data-fetching', 'yes');
    window.cdnDataManager.getConfig(this.activeConfigName, function(config, status) {
      this.content.removeAttribute('data-fetching');
      if (status >= 400) {
        // TODO: better error messaging
        this.content.textContent = 'ERROR: Could not fetch page config';

      this.fetchedConfigName = this.activeConfigName;

  CDNPage.prototype.saveConfigModal = function() {
    var that = this, content, modal, para, title, label, input, button;

    content = document.createElement('form');
    content.className = 'cdn-page-edit-modal';

    title = document.createElement('h3');
    title.textContent = 'Save view as';
    content.appendChild(title)

    para = document.createElement('p');
    para.textContent = 'Pick a name to save the current view for sharing with all users.';
    content.appendChild(para);

    para = document.createElement('p');
    label = document.createElement('label');
    label.textContent = 'Name';
    input = document.createElement('input');
    input.type = 'text';
    input.value = this.activeConfigName;
    input.required = true;

    para.appendChild(label);

    para = document.createElement('p');
    button = document.createElement('input');
    button.type = 'submit';
    button.value = 'Save';
    button.setAttribute('data-button-hint', 'good');
    para.appendChild(button);
    content.appendChild(para);

    content.addEventListener('submit', function(event) {
      var newConfig, name, allowOverwrite = false;

      function saveNewConfig() {
        // TODO: use cdnDataManager to post through fetcher
        CDNHelpers.postJSON(cdnDataManager.fetcher.apiRoot + '/view/' + encodeURIComponent(name) + '/', newConfig, function() {
          cdnDataManager.invalidateConfigCache(name);
          that.updateHash({view: name});
          that.viewSelectionControls.className = '';
          modal.hide();
          that.toggleEditMode(false);
        });
      }

      event.preventDefault();
      name = (''+input.value).trim();
      if (! name) {
        return;
      }

      if (['default', 'default_testsuite', 'default_history', 'default_timing'].indexOf(name) >= 0) {
        if (!confirm('Are you sure you want to overwrite the default view for all users?')) {
          return;
        }
        alert('I\'m sorry, Dave. I\'m afraid I can\'t do that.\n    -- Hal');
        return;
        allowOverwrite = true;
      }

      button.disabled = true;
      button.value = 'Saving...';

      newConfig = CDNHelpers.shallowClone(that.activeConfig);
      newConfig[that.activeTab] = that.configEditors.map(function(configEditor) {
        return configEditor.getConfig();
      });

      if (allowOverwrite) {
        saveNewConfig();
      } else {
        cdnDataManager.getConfig(name, function(config, status) {
          if (status < 400) {
            if (!confirm('A view with the name '+name+' already exists. Are you sure you want to overwrite the view for all users?')) {
              button.disabled = false;
              button.value = 'Save';
              return;

          saveNewConfig();

    modal = new CDNModal(content);

  CDNPage.prototype.toggleEditMode = function(force) {

  CDNPage.prototype.defaultConfigChanged = function(event) {
    var synchronous, updated, defaultValue;
    if (! this.pendingHashed.view) {
      synchronous = 1;

            this.activeConfigName = name;

            if (synchronous) {

      if (synchronous < 2) {
        synchronous = 0;
        defaultValue = cdnDataManager.getDefaultConfigName();
        if (this.activeConfigName !== defaultValue) {
          this.activeConfigName = defaultValue;
          updated = true;
        }
      }
    }
    if (! this.pendingHashed.tab) {
      defaultValue = cdnDataManager.getDefaultTabName(undefined, this.pendingHashed);
      if (this.activeTab !== defaultValue) {

  CDNPage.prototype.applyHashDefaults = function(hashed) {

  CDNPage.prototype.hashchange = function(event) {
    var hash, components, component, name, value, hashed, i, updated, notifyChange, applyingDefaults, minorChange, viewTabTitle, synchronous, strings, defaultValue;

    this.changingHash = true;
    this.hashInvalid = false;
    updated = false;
    notifyChange = false;
    applyingDefaults = false;
    minorChange = false;

    // Hash components forced to be strings (important if they can be an empty string)
    strings = ['path', 'view', 'tab'];

    hash = '';
    // location.hash is an object, not a String, so make sure we use the String
    // methods on it.
    if (String.prototype.charAt.call(location.hash) === '#') {
      hash = String.prototype.slice.call(location.hash, 1);
    }

    hashed = {};
    // Use non-capturing parenthesis (?:) or the matched string appears in the
    // output
    components = hash.split(/(?:&|%26)+/);
    for (i = 0; i < components.length; i++) {
      component = components[i].split(/(?:=|%3D)+/i);
      name = decodeURIComponent(component.shift());
      value = true;
      if (component.length > 0 || (name && strings.indexOf(name) >= 0)) {
        value = decodeURIComponent(component.join('='));
      }
      if (name) {
        if (hashed[name]) {
          if (hashed[name] instanceof Array) {
            hashed[name].push(value);
          } else {
            hashed[name] = [hashed[name], value];
          }
        } else {
          hashed[name] = value;
        }
      }
    }

    this.pendingHashed = hashed;

    // coerce to boolean false if false
    hashed.delta = hashed.delta === 'false' ? false : (hashed.delta || false);

    if (this.applyHashDefaults(hashed)) {
      // If defaults were applied, the hash was updated (which will call this
      // function again so return immediately)
      applyingDefaults = true;
    }

    if (this.showingPercent === (hashed.delta === 'raw')) {
      updated = true;
      minorChange = true;
    } else if (hashed.view && this.activeConfigName !== hashed.view) {
      this.toggleEditMode(false);
      this.viewSelectionControls.className = '';
      updated = true;
    } else if (hashed.tab && this.activeTab !== hashed.tab) {
      updated = true;
    } else if (hashed.table) {
      updated = true;
    }

    window.cdnDataManager.hashchange(hashed, (updated && !minorChange) || applyingDefaults);

    if (! applyingDefaults) {
      if (this.showingPercent === (hashed.delta === 'raw')) {
        notifyChange = true;
      }

      if ((hashed.view && this.activeConfigName !== hashed.view) || (hashed.tab && this.activeTab !== hashed.tab)) {
        // Too large a change for the event notification
        notifyChange = false;
      }
    }

    // potentially no behaviour change for javascript - pure CSS
    if (hashed.delta === 'none') {
      document.body.removeAttribute('data-showing-deltas');
    } else {
      document.body.setAttribute('data-showing-deltas', 'yes');
    }

    viewTabTitle = '';
    if (hashed.view) {
      viewTabTitle = ' - ' + hashed.view;
      if (hashed.tab) {
        viewTabTitle += '/' + hashed.tab;
      } else {
        viewTabTitle += '/Default';
      }
    } else if (hashed.tab) {
      viewTabTitle = ' - Default/' + hashed.tab;
    }

    document.title = 'Metrics Server' +
      viewTabTitle +
      (hashed.path ? ' - ' + hashed.path.split('/').slice(-1)[0] : '');

    this.changingHash = false;
    if (this.hashInvalid) {
      this.hashInvalid = false;
      if (this.updateHash({})) {
        return;
      }
    }
    if (! hashed.view) {
      synchronous = 1;
      cdnDataManager.getCustomDefaultConfig(function (name) {
        if (name && ! hashed.view) {
          if (this.activeConfigName != name) {
            this.activeConfigName = name;
            updated = true;
            // The callback may be synchronous if the data is cached
            if (! synchronous) {
              console.log('getCustomDefaultConfig - CDNPage redraw components');
              this.fetchActiveConfig();
              this.updateViewSelection();
            }
          }
          synchronous = 2;
        }
      }.bind(this));
      if (synchronous < 2) {
        synchronous = 0;
        defaultValue = cdnDataManager.getDefaultConfigName();
        if (this.activeConfigName !== defaultValue) {
          this.activeConfigName = defaultValue;
          updated = true;
        }
      }
    }
    if (! hashed.tab) {
      defaultValue = cdnDataManager.getDefaultTabName(undefined, hashed);
      if (this.fetchedConfigName === this.activeConfigName) {
        if (this.activeConfig[defaultValue] === undefined) {
          defaultValue = CDNHelpers.firstKey(this.activeConfig);
        }
      }
      if (this.activeTab !== defaultValue) {
        this.activeTab = defaultValue;
        updated = true;
      }
    }
    if (notifyChange) {
      this.showingPercent = !(hashed.delta === 'raw');
      console.log('hashChange - CDNPage notify event');
      this._notifyPresentationChanged();
    } else if (updated) {
      this.showingPercent = !(hashed.delta === 'raw');
      if (hashed.view) {
        this.activeConfigName = hashed.view;
      }
      if (hashed.tab) {
        this.activeTab = hashed.tab;
      }
      console.log('hashChange - CDNPage redraw components');
      this.fetchActiveConfig();
      this.updateViewSelection();
    }
    this.renderBreadcrumbs();
    this.renderTabs();
    this.renderDeltaButton();
    this._notifyHashChanged();
  };

  CDNPage.prototype.hashStrFromObj = function(hashed) {
    var parts, key, value, i;

    parts = [];
    for (key in hashed) {
      value = hashed[key];
      if (value === undefined || value === null) {
        continue;
      }
      if (value instanceof Array) {
        for (i = 0; i < value.length; i++) {
          parts.push(encodeURIComponent(key) + '=' + encodeURIComponent(value[i]));
        }
      } else if (value === true) {
        // Boolean true is a present value, don't include the value in the hash
        parts.push(encodeURIComponent(key));
      } else if (value === false) {
        // Boolean false is an omitted value, don't include the key in the hash
      } else {
        parts.push(encodeURIComponent(key) + '=' + encodeURIComponent(value));
      }
    }

    return '#' + parts.join('&');
  };

  CDNPage.prototype.updateHash = function(newHashed) {
    var parts, key, value, i, newHash;

    delete this.pendingHashed.table;
    CDNHelpers.assignObj(this.pendingHashed, newHashed);

    if (this.changingHash) {
      this.hashInvalid = true;
      return true;
    }

    for (key in this.pendingHashed) {
      value = this.pendingHashed[key];
      if (value === undefined || value === null) {
        delete this.pendingHashed[key];
      }
    }

    newHash = this.hashStrFromObj(this.pendingHashed);
    // location.hash is an object not a string, don't use !== to compare
    if (newHash != location.hash) {
      location.hash = newHash;
      return true;
    }
    return false;
  };

  CDNPage.prototype._notifyPresentationChanged = function() {
    CDNHelpers.events.dispatch('cdnpresentationchanged');
  };

  CDNPage.prototype._notifyHashChanged = function() {
    CDNHelpers.events.dispatch('cdnhashchanged');
  };

  // cdnPage is a singleton
  window.cdnPage = new CDNPage();

})();

// Top-level function so we can have a per-file var scope
(function() {

  function CDNConfigEditor(config, component) {

  CDNConfigEditor.prototype.setComponent = function(component) {

  };

  CDNConfigEditor.prototype.edit = function() {

    container = document.createElement('form');
    container.className = 'cdn-edit-modal';

    title = document.createElement('h3');
    title.textContent = this.config.component;
    container.appendChild(title);

    button.type = 'submit';
    button.value = 'Done';

  };

    for (key in description) {

      case 'metrics_array':
        this.renderEditableMetricsArray(container, key, editable);

      case 'text':
        this.renderEditableText(container, key, editable);

  CDNConfigEditor.prototype.renderEditableText = function(toplevel, key, editable) {

    container = document.createElement('div');
    container.className = 'cdn-edit-text';
    toplevel.appendChild(container);

    label = document.createElement('label');
    label.textContent = editable.label;
    container.appendChild(label);

    input = document.createElement('input');
    input.type = 'text';
    input.value = this.config[key] || '';

      that.config[key] = input.value;
    });

  CDNConfigEditor.prototype.renderEditableRadio = function(toplevel, key, editable) {

    inputs = [];

    container = document.createElement('div');
    container.className = 'cdn-edit-radio';
    toplevel.appendChild(container);

    label = document.createElement('div');
    label.className = 'cdn-edit-radio-title';
    label.textContent = editable.label;
    container.appendChild(label);

    for (name in editable.values) {
      label = document.createElement('label');
      label.textContent = name;

  CDNConfigEditor.prototype.renderEditableMetricsArray = function(toplevel, key, editable) {

        container,
        content,
        pickerForm,
        picker,
        add,
        scrollContainer,
        metricTable,
        metricTbody,
        configArray,

        metricCache;

    function setHighlight(index) {
      highlightRow = index;

      highlightTimeout = setTimeout(function() {

    function makeElement(tag, className, textContent, parentNode) {

    function renderBranch(branch, select, focus) {
      var option, key, options, i, value, seenValue, nextNode, node;
      if (select) {
        if (CDNHelpers.firstKey(branch)) {
          options = select.childNodes;
          i = 2;
          value = select.value;
          seenValue = (value === '' || value === '*');
          for (key in branch) {
            if (key === '*') {

        input = makeElement('select', undefined, undefined, td);

          option.value = values[i];

          input.value = metricConfig[propertyName];
        }

          } else {
            metricConfig[propertyName] = input.value;
          }

        CDNHelpers.events.add('cdndatachanged', metricCacheHandler);

          switch (item) {

              break;
            case 'run':
              cdnDataManager.getComparableRuns(intermediateCallback);

            for (key in config) {

            if (live) {

                if (! runs[i]) {

                metrics = runs[i].metrics;
                for (key in metrics) {
                  parts = key.split('.');
                  branch = cache;
                  for (j = 0; j < parts.length; j++) {
                    if (j < parts.length - 1 && parts[j].match(/(?:^|[^\\])(?:\\\\)*(?:\\)$/)) {

                      parts.splice(j, 2, parts[j] + '.' + parts[j + 1]);
                      j--;

                    }

          configHandler(items[0]);
          runHandler(items[1]);

    };

    configArray = this.config[key];

    container = makeElement('div', 'cdn-edit-metric', undefined, toplevel);

    makeElement('div', 'cdn-edit-metric-title', editable.label, container);

    pickerForm = makeElement('form', 'cdn-metric-picker-outer', undefined, container);
    picker = makeElement('div', 'cdn-metric-picker', undefined, pickerForm);
    add = makeElement('input', undefined, undefined, pickerForm);
    add.type = 'submit';
    add.value = 'Add';

    pickerForm.addEventListener('submit', function(event) {
      var newMetric;
      event.preventDefault();
      newMetric = getAddValue();
      if (newMetric.trim() === '') {

        return;
      };

      if (newMetric.match(/[\*%]/)) {
        configArray.push({
          metric: newMetric,
          group: newMetric
        });
      } else {
        configArray.push({
          metric: newMetric,
          title: newMetric

    scrollContainer = makeElement('div', 'scroll-container', undefined, container);
    metricTable = makeElement('table', undefined, undefined, scrollContainer);
    tr = makeElement('tr', undefined, undefined, makeElement('thead', undefined, undefined, metricTable));
    makeElement('th', undefined, 'Metric', tr);
    makeElement('th', undefined, 'Title', tr);
    makeElement('th', undefined, 'Group', tr);
    makeElement('th', undefined, 'Graph', tr);
    makeElement('th', undefined, 'Actions', tr);

    renderMetricRows();
    renderBranches();
  };

  };

  };

  CDNCPUTimeStatement.prototype.render = function() {

    comparisons.push(new CDNMetricComparison('flow.cputime.not_child'));
    comparisons.push(new CDNMetricComparison('flow.realtime.not_child'));

    cpuTimes = comparisons[1];
    wallTimes = comparisons[2];
    runCount = runIds.length;

    names = (''+cdnDataManager.getComparisonPath()).split('/').filter(function(s){return !!s;});

    name = names[names.length - 1] || '';
    if (runCount > 0) {
      if (name) {
        name = 'Snapshot '+name;

        name = 'Top level run';

    CDNHelpers.removeChildren(this.container);

      for (j = 1; j <= 2; j++) {

          continue;

        type = j === 1 ? 'CPU' : 'wall';

        el.textContent = name+' internally spent '+type+' time:';
        this.container.appendChild(el);
        for (i = 0; i < runCount; i++) {
          if (! comparisons[j][i].defined || comparisons[j][i].rawValue === 0) {
            continue;

      if ((cpuTimes[0].defined && cpuTimes[0].rawValue !== 0) && (wallTimes[0].defined && wallTimes[0].rawValue !== 0)) {

        el.textContent = name+' internally spent '+cpuTimes[0].renderedValue+' CPU time.';

  CDNCPUTimeGraph.prototype._receiveSnapshots = function(comparableSnapshots) {

    minY = Infinity;

            }
            if (point > maxY) {
              maxY = point;
            }
          } else {
            if (point < minX) {
              minX = point;
            }
            if (point > maxX) {
              maxX = point;
            }
          }
        });
      });
      return ret;
    });

    svg.setAttributeNS(null, 'viewBox', (minX - 2) + ' ' + (minY - 2) + ' ' + ((maxX - minX) + 4) + ' ' + ((maxY - minY) + 4));
    svg.setAttributeNS(null, 'version', '1.1');
    svg.setAttributeNS(null, 'preserveAspectRatio', 'xMaxYMid meet');

    function drawRect(color, fill, x0, y0, x1, y1) {
      var rect;

      rect = document.createElementNS(xmlns, 'rect');
      rect.setAttributeNS(null, 'stroke', color);
      rect.setAttributeNS(null, 'stroke-width', '4');
      rect.setAttributeNS(null, 'x', x0);
      rect.setAttributeNS(null, 'y', y0);
      rect.setAttributeNS(null, 'width', x1 - x0);
      rect.setAttributeNS(null, 'height', y1 - y0);
      rect.setAttributeNS(null, 'fill', fill || 'none');
      svg.appendChild(rect);
    }

    function drawPolygon(color, fill, x0, y0) {
      var polygon, points;

      points = Array.prototype.slice.call(arguments, 2);

      polygon = document.createElementNS(xmlns, 'polygon');
      polygon.setAttributeNS(null, 'stroke', color);
      polygon.setAttributeNS(null, 'stroke-width', '4');
      polygon.setAttributeNS(null, 'points', points.join(' '));
      polygon.setAttributeNS(null, 'fill', fill || 'none');
      svg.appendChild(polygon);
    }

    //drawRect('black', 'black', minX - 2, minY - 2, maxX + 2, maxY + 2);

    data.map(function(layer, layerNum) {
      layer.shapes.map(function(shape) {
        var args;
        args = shape.slice();
        args.unshift(CDNColor.get(layerNum), false);
        if (shape.length === 4) {
          drawRect.apply(this, args);
        } else {
          drawPolygon.apply(this, args);
        }
      });
    });

    CDNHelpers.removeChildren(this.container);
    this.container.appendChild(svg);
  };



  function CDNCollapse(container, config) {

    this.headerContainer.addEventListener('click', this.toggleHidden.bind(this, undefined), false);
    this.container.appendChild(this.headerContainer);

    this.nestedContainer.setAttribute('data-component', this.componentName);

  CDNCollapse.prototype.finalize = function() {

  };
  CDNCollapse.prototype.render = function() {

  CDNCollapse.prototype.toggleHidden = function(force) {

  window.CDNCPUTimeStatement = CDNCPUTimeStatement;

    <script type="text/javascript">"use strict";

// Top-level function so we can have a per-file var scope
(function() {

  CDNTable.prototype._metricComparison = function(config, subPath, secondarySubPath) {
    if (config.header) {
      return new CDNRunHeaderComparison(config.header, subPath);

      return new CDNMetricComparison(config.metric, subPath, config.metricCfg, secondarySubPath);
    } else if (this.config.inheritance_selection) {

  CDNTable.prototype.draw = function() {
